import React from "react";
import Todo from "./Todo";
const todos = ({ todos, onDelete, completeHandler, showSpinner }) => {
  return (
    <div>
      <div className="todos">
        {todos.map((todo) => (
          <Todo
            todo={todo}
            key={todo.id}
            onDelete={onDelete}
            completeHandler={completeHandler}
          />
        ))}
      </div>
    </div>
  );
};

export default todos;
